LaravelCommon\App\Entities\User\Token:
  table: user_tokens
  primaryKey: id
  props: 
    id:  
      type: int
      isEntity: false
      field: id
    user: 
      type: App\Entities\User
      isEntity: true
      foreignKey: user_id
      relationType: one_to_many
      inversedBy: tokens
      field: user_id
    token:  
      type: string
      isEntity: false
      field: token
    expiredAt:  
      type: DateTime
      isEntity: false
      field: expired_at
    createdAt: 
        type: DateTime
        isEntity: false
        field: created_at
    createdBy: 
        type: string
        isEntity: false
        field: created_by
    updatedAt: 
        type: DateTime
        isEntity: false
        field: updated_at
    updatedBy: 
        type: string
        isEntity: false
        field: updated_by